document.getElementById("vue_app").innerHTML=`
<div class="chat-container">
    <div class="message-list" ref="messageList">
      <div v-for="(message, index) in messages" :key="index" class="message-item" :class="{ 'user-message': message.type === 'user' }">
        <el-avatar v-if="!['sys','user'].includes(message.type)" :icon="dbDict[agentsDict[message.type]]||'el-icon-user-solid'"></el-avatar>
        <div v-if="message.type === 'sys'" style="width:100%;color:#6f6fb7;text-align:center">{{ message.content }}</div>
        <div class="message-content" v-else>
          <div class="message-text" v-html="messagesDict[message.id]||message.content"  @click="copyCode"></div>
          <el-image class="message-image" v-if="message.image" :src="message.image" :preview-src-list="[message.image]"></el-image>
            <div v-if="message.files && message.files.length" class="file-list">
                <div v-for="(file, fileIndex) in message.files" :key="fileIndex" class="file-item">
                    <i :class="getFileIcon(file)"></i> {{file.name }}
                </div>
            </div>
            <div class="message-time" v-if="!['sys'].includes(message.type)">
                <i class="el-icon-toilet-paper" v-if="message.token">{{ message.token }}</i>
                <div class="message-actions">
                    <i class="el-icon-delete"
                       @click.stop="deleteMessage(index)"
                       title="删除"></i>
                    <i class="el-icon-document-copy"
                       @click.stop="copyMessage(message.content)"
                       title="复制"></i>
                       <el-tooltip :content="message.raw" v-if="message.raw" placement="top" effect="light">
                    <i class="el-icon-coin"  @click.stop="copyMessage(message.raw)"></i>
                       </el-tooltip>
                </div>
            </div>
        </div>
      </div>
      <div class="message-item thinking" v-if="isThinking">
        <el-avatar icon="el-icon-user-solid"></el-avatar>
          <div class="message-content">
          <div class="message-text">
            <div class="thinking-dots">
              <span class="dot"></span>
              <span class="dot"></span>
              <span class="dot"></span>
            </div>
          </div>
        </div>
      </div>
    </div>
    <div class="input-area">
      <div class="input-actions">
        <span class="el-icon-paperclip action-btn" title="上传文件" @click="triggerFileUpload"></span>
        <input type="file" ref="fileInput" multiple @change="handleFileUpload" class="hidden-file-input">
        <span class="el-icon-picture-outline action-btn" title="粘贴图片" @click="pasteImage"></span>
                  <el-switch v-model="think" active-text="思考" size="mini"></el-switch>
        <el-switch v-model="search" active-text="联网" size="mini"></el-switch>
        <el-switch v-model="history" active-text="历史" size="mini"></el-switch>
        <el-input v-if="history" style="width:50px;" v-model="maxhis" size="mini"></el-input>
        <el-switch v-model="stream" active-text="流式" size="mini"></el-switch>
        <el-tooltip content="历史记录" placement="top" effect="light">
          <el-button  size="mini"  @click="drawer=!drawer" circle icon="el-icon-guide"></el-button>
        </el-tooltip>
        <el-tooltip content="保存" placement="top" effect="light">
          <el-button  size="mini"  @click="savehis" circle icon="el-icon-star-off"></el-button>
        </el-tooltip>
        <el-tooltip content="清空历史" placement="top" effect="light">
          <el-button  size="mini"  @click="clearHistory" circle icon="el-icon-delete"></el-button>
        </el-tooltip>
          <el-tooltip content="开启新会话" placement="top" effect="light">
          <el-button  size="mini"  @click="startNew" circle icon="el-icon-chat-line-round"></el-button>
          </el-tooltip>
      </div>
      <el-autocomplete v-model="inputMessage" ref="myInput"
        :fetch-suggestions="querySearch"
        size="small"
        placeholder="/切换数据源，@切换智能体, 请输入您的问题"
        :disabled="isThinking"
        @select="handleSelect"
        @keyup.enter.native="sendMessage"
      >
        <el-button slot="append" icon="el-icon-position" size="small" :loading="isThinking" @click="sendMessage">发送</el-button>
      </el-autocomplete>
      <div class="uploaded-files" v-if="uploadedFiles.length > 0">
        <div v-for="(file, index) in uploadedFiles" :key="index" class="uploaded-file">
            <i :class="getFileIcon(file)"></i> {{file.name}}
            <span class="remove-btn" @click="removeFile(index)">
                <i class="el-icon-close"></i>
            </span>
        </div>
      </div>
    </div>
  </div>

<el-drawer
  title="收藏的会话"
  :visible.sync="drawer"
  direction="ltr"
  size="300px"
>
  <div class="clean-history-list">
    <div 
      v-for="item in hisList" 
      :key="item.id"
      class="history-item"
       @click="readhis(item.id)"
    >
      <div class="history-content">
        <div class="history-name">{{ item.name }}</div>
        <div class="history-time">{{ item.time }}</div>
      </div>
      <el-button
        type="text"
        icon="el-icon-close"
        class="delete-btn"
        @click.stop="deletehis(item.id)"
      />
    </div>
    
    <el-empty v-if="hisList.length === 0" description="暂无历史记录"></el-empty>
  </div>
</el-drawer>
`;

